import './App.css';

function App() {

  return (
    <div className="App">
      <div className="header">
        <img src="https://s2-recruiting.cdn.greenhouse.io/external_greenhouse_job_boards/logos/400/823/300/original/Orchard-Logo-Greenhouse.png?1578410187" />
      </div>
      <div className="indHouseContainer">
        <div className="indHousePhotoContainer">
          <img src="https://images.estately.net/22_14044376_0_1552942469_320x212a.jpg" alt="820 Carolina Way"/>
        </div>
        <div className="indHouseDetailsContainer">
          <h3>820 Carolina Way</h3>
          <p>4 beds | 3 baths | 2,795 sqft</p>
          <h2>$346,900</h2>
        </div>
      </div>
      <div className="indHouseButtonsContainer">
          <div className="voteButton">
          up
          </div>
          <div className="voteButton">
          heart
          </div>
          <div className="voteButton">
          down
          </div>
        </div>
    </div>
  );
}

export default App;


